import React from "react";
import "./Welcome.css";


function Welcome() {

    return (
        <div>
            <div className="animate__animated animate__slideInLeft">
                <div className="jumbotron" style={{ height: "250px", marginTop: "20px", backgroundColor: "#FFF8DC" }}>
                    <h1 className="display-4">Paul Ijames Web Development</h1>
                    <p className="lead">Scroll down for more information or visit his Projects and Contact page.</p>
                    <div className="btn-layout">
                        <a className="btn btn-md" style={{ backgroundColor: "#36454f", marginBottom: "10px", marginTop: "10px" }} href="https://github.com/Stevenijames">GitHub</a><br></br><a className="btn btn-md" style={{ backgroundColor: "#36454f", marginBottom: "10px", marginTop: "10px" }} href="https://www.linkedin.com/in/paul-ijames-94765054">LinkedIn</a>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Welcome;
